// Logo.js
import React, { useRef } from 'react';
import { useFrame } from '@react-three/fiber';
import { Text } from '@react-three/drei';

const Logo = () => {
  const logoRef = useRef();

  // Animación para mover hacia arriba
  useFrame(() => {
    const targetY = 3;
    const speed = 0.01;


    if (logoRef.current.position.y < targetY) {
      logoRef.current.position.y += speed;

        if (logoRef.current.position.y > targetY){
            logoRef.current.position.y = targetY;
        }
    }
  });

  return (
    <group ref={logoRef}>
      <Text
        position={[0, 0, 0]}
        fontSize={1}
        color="white"
        anchorX="center"
        anchorY="middle"
        letterSpacing={-0.05}
        material-color="white"
        className="logo-text white-text"
      >
        Diving<span className='blue-text'>ES</span>
      </Text>
    </group>
  );
};

export default Logo;
